'use strict';

function onFileParsed (input) {
    const binningLimit = 5000;
    // const binningLimit = undefined;
    const binningFraction = 50;
    console.log(input);
    input.matchupRecords.forEach(record => {
        if(record.gameResults.length > 0){
            var matchingIds = true;
            record.playerIds.forEach(id => {
                matchingIds &= (id == record.playerIds[0]);
            });
            if(matchingIds){
                console.log(record.playerIds[0]);
                let counters = [];
                let csvRows = [];
                csvRows[0] = [];
                csvRows[0].push("Matches");
                for(let i=0; i<input.matchupSize; i++){
                    counters[i] = 0;
                    csvRows[0].push(`Player ${(i+1)}`);
                }
                let numRecordsToCheck = record.gameResults.length;
                if(binningLimit != undefined){
                    numRecordsToCheck = Math.min(binningLimit, numRecordsToCheck);
                    console.log(`limit is ${numRecordsToCheck}`);
                }else{
                    console.log("undefined limit!");
                }
                const binning = numRecordsToCheck / binningFraction;
                console.log(`binning is ${binning} matches`);
                record.gameResults.forEach((result, resultIndex) => {
                    if(resultIndex >= binningLimit){
                        return;
                    }
                    for(let i=0; i<result.length; i++){
                        const c = result.charAt(i);
                        if(c == "W"){
                            counters[i]++;
                        }
                    }
                    if((resultIndex + 1) % binning == 0){
                        const newRow = [];
                        newRow.push(resultIndex + 1);
                        counters.forEach((c, ci) => {
                            const percentage = ((100 * c) / (resultIndex + 1));
                            newRow.push(`${percentage.toFixed(2)}`);
                        });
                        csvRows.push(newRow);
                    }
                });
                console.log(counters);
                let csv = "";
                csvRows.forEach(row => {
                    csv += row.join(", ");
                    csv += "\n";
                });
                console.log(csv);
            }
        }
    });
}

